import React, { Component } from "react";
import SliderShow from "../components/SliderShow";
import { GridList, Link } from "@material-ui/core";

class Home extends Component {
  render() {
    return (
      <div>
        <SliderShow />
        <GridList
          cols={4}
          spacing={10}
          cellHeight={350}
          style={{ justifyContent: "center" }}
        >
          {[1, 2, 3, 4, 5, 6, 7, 8].map(t => (
            <Link href="">
              <img
                src={require("../images/75210475_1457858117712801_1937296649730636142_n.jpg")}
                alt=""
                style={{ maxWidth: 330, marginB }}
              />
            </Link>
          ))}
        </GridList>
      </div>
    );
  }
}

export default Home;
